import Pizza from './Pizza';
import Beer from './Beer';
import Cocktails from './Cocktails';

function Menu() {
  return (
    <div className="Menu-page">
      <Pizza pizzaOrder={this.addToOrder} />
      <Beer />
      <Cocktails />
    </div>
  );
}

export default Menu;
